INSERT INTO `artikel` (`id_artikel`, `judul_artikel`, `isi_artikel`, `tgl_artikel`) VALUES
(10, 'A Very Special First', 'It is so rare for us to be able to say that we are visiting a country for the very first time, so this is an extra special announcement for us. After over 31 years of traveling to almost all corners of the world for so many amazing, wild and thrilling adventures, we will finally be heading to China!! We’ll be hitting the stage in Shanghai at the Mercedes-Benz Arena on August 13.\r\n\r\nTickets go on sale on June 7 at 10:00 AM local time. A limited of tickets are being held for Met Club members. Club Members should login to Metallica.com for more information on how to buy these tickets. To purchase tickets, call or click here:\r\n\r\nTicket Order: 400-610-3721, Piao.com.cn\r\nEnglish: 021-5150-9199, SmartShanghai.com\r\n\r\nAnd please keep your eyes on this site for more August announcements coming soon.', '2013-06-10 00:00:00'),
(21, 'The European Summer Vacation Tradition Continues', 'You know how we love our summer vacations in Europe, so we''re really excited to announce that we will be headlining the Roskilde Festival in Denmark on July 6, 2013! It''s been ten long years since we''ve been to this classic festival and we can''t wait to return.\r\n\r\nTickets are already available for the entire festival here: http://roskilde-festival.dk/ticket.\r\n\r\nLooking forward to seeing you out there!', '2013-06-10 00:00:00'),
(22, 'August Addition', 'We’re just back from some amazing nights in the United Arab Emirates and South Africa and are now looking forward to our next adventures on the road with the addition of the Hyundai Card Super Concert 19 CITYBREAK festival in Seoul, South Korea on Sunday, August 18. We’ll be closing out the festival on that night; for more information about the festival visit citybreak.superseries.kr.\r\n\r\nHyundai Card customers will have first crack at tickets on Monday, May 20 starting at noon local time. The public ticket sale begins 24 hours later on Tuesday, May 21, also at noon local time. Please note that only two day passes will be available at this time; to purchase tickets, visit http://ticket.interpark.com.\r\n\r\nWe have a few other dates in August up our sleeves, so keep watching here for additional announcements!', '2013-06-10 00:00:00');

